        /// <summary>
        /// The ISO 639-1 is a two letter code. Example: se, no, en
        /// </summary>
        public String ISO639_1;

        /// <summary>
        /// The ISO 639-2 is a three letter code. Example: sve, nor, eng
        /// </summary>
        public String ISO639_2;

        /// <summary>
        /// ISO639_3 is a superset of ISO 639-1 and of the individual languages 
        /// in ISO 639-2. Since ISO 639-2 also includes language collections, 
        /// whereas Part 3 does not, ISO 639-3 is not a superset of ISO 639-2. 
        /// Where B and T codes exist in ISO 639-2, it uses the T-codes.
        /// <para>ISO 639-3 is under development (as on 2006-12-21) and is not yet stable</para>
        /// </summary>
        public String ISO639_3;

        /// <summary>
        /// Name of the language. Always set english name as standard.
        /// </summary>
        [SynonymousTo("Name")]
        public String EnglishName;


